import React from "react";
import { Link } from "react-router-dom";
import "../styles/home.css";

const Home = () => {
  return (
    <div className="home">
      <header className="hero">
        <h1>Welcome to Medicare</h1>
        <p>Your One-Stop Solution for Online Doctor Consultations</p>
        <Link to="/services" className="btn">Explore Services</Link>
      </header>
      
      <section className="features">
        <div className="feature">
          <h2>Book Appointments</h2>
          <p>Schedule your appointment with top doctors instantly.</p>
        </div>
        <div className="feature">
          <h2>Video Consultations</h2>
          <p>Consult with doctors from the comfort of your home.</p>
        </div>
        <div className="feature">
          <h2>Prescription & Pharmacy</h2>
          <p>Receive prescriptions and order medicines online.</p>
        </div>
      </section>
    </div>
  );
};

export default Home;
